import forest from './images/forest.jpg';
import hare from './images/hare.jpg';
import dinning from './images/dinning-and-kitchen.jpg';


export default function Footer() {
  return (
    <footer>
        <div className='cards'>
            <div>
                <img src={ forest } alt='react logo' className='react'/>
                <p>⭐ 5.8(6) • USA</p>
            </div>
            <div>
                <img src={ hare } alt='hare logo'/>
                <p>⭐ 5.8</p>
            </div>
            <div>
                <img src={ dinning } alt='dinning logo'/>
                <p>⭐ 5.8</p>
            </div>
            </div>
    </footer>
  );
};
